window.bookSummaryJSON = "<p><b>We thought we were alone....</b></p> <p><b>We’re going to wish we were.</b>&nbsp;</p> <p>Jason McKay and Shannon Stark, two young Republic Space Fleet Intelligence officers, are given the leadership of a new special ops unit. The mission? Guard the spoiled daughter of an important senator on a tour of the colonies.&nbsp;</p> <p>Neither of them thought the mission would be anything more than babysitting...until the aliens invaded the colony.&nbsp;</p> <p>Implacable, relentless, merciless, the armored creatures slaughter everyone who gets in their way. The team is forced to go on the run with the people they’re supposed to protect.&nbsp;</p> <p>But survival will be the least of their challenges. Because it’s not as simple as an alien invasion, and the truth may be even stranger than they can imagine.&nbsp;</p> <p>Jason and Shannon are forced to weigh the lives of the people they lead - and the ones they love - against their duty, honor, and planet.&nbsp;</p> <p><b>Don't miss this thrilling military sci-fi series from the best-selling author of the Drop Trooper series. Grab your copy today!</b></p>"; 
